import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <main className="apresentacao">
            <section className="apresentacao__conteudo">
                <h1 className="apresentacao__conteudo__titulo">
                    BEM-VINDO AO <strong className="titulodestaque">CAÇA-PREÇO!</strong>
                </h1>
                <p className="apresentacao__conteudo__texto">
                    Olá, eu sou a Lourdes. Vou te ajudar a economizar muito!
                </p>
                <div className="apresentacao__links">
                    <h2 className="apresentacao__links__subtitulo">Escolha a plataforma:</h2>
                    <Link to="/login" className="apresentacao__links__navegacao">
                        <img src="/assets/twitter.png" alt="Entrar" />Entrar
                    </Link>
                    <a className="apresentacao__links__navegacao" href="#">
                        <img src="/assets/github.png" alt="Jogar" />Jogar
                    </a>
                    <a className="apresentacao__links__navegacao" href="#">
                        <img src="/assets/instagram.png" alt="Unicornio" />Unicornio
                    </a>
                </div>
            </section>
            <img className="apresentacao_imagem" src="/assets/ia.png" alt="Lourdes" />
        </main>
    );
};

export default Home;
